const Tag = ({ tag }: { tag: string }) => {

    const tags = tag.split('>');
    return (
        <>
            <ul className="flex flex-col">
                {tags.map((tag) => <li>{tag}</li>)}
            </ul>
            {`${tags}`}
        </>
    )
}

export default Tag;
